import React from 'react'

import style from '../nav.module.css'

const Nav = () => {
  return (
    <div>
      <h1 className={style.h1}>PotLucky</h1>
      <h3 className={style.h1}>Discover new vegan meals</h3>
    </div>
  )
}

export default Nav
